describe.only('User Posts', () => {
    it('/post', async() => {
        const data = {
            user_id:"4",
            title:"My Custom Title",
            body:"my custom blog post"
        }
        
        const res = await request
        .post('posts')
        .set("Authorization",`Bearer ${Token}`)
        .send(data);

        console.log(res.body)
    });
});

